    false,nt"url": null,nt"notes": "This annual narrative report for Presquile
    National Wildlife Refuge and James River National Wildlife Refuge outlines Refuge
    accomplishments during the 1993 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. Refuge
    administration is outlined; information about personnel, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, and pest control. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    and waterbirds, shorebirds, raptors, game mammals, other resident wildlife, and
    marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, wildlife observation,
    other non-wildlife oriented recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, and equipment utilization and replacement. Items of interest
    are provided at the end. Refuge brochures and field guides are attached.",nt"owner_org":
